import React from 'react';
import { RadialBarChart, RadialBar, Legend } from 'recharts';

const MonthlyClock = ({ data }) => {
    return (
        <RadialBarChart width={600} height={400} innerRadius="50%" outerRadius="80%" data={data}>
            <RadialBar
                minAngle={15}
                label={{ fill: '#fff', position: 'insideStart' }}
                background
                clockWise
                dataKey="waterUsage"
            />
            <Legend iconSize={10} width={120} height={140} layout="vertical" verticalAlign="middle" align="right" />
        </RadialBarChart>
    );
};

export default MonthlyClock;
